DELIMITER $$
--
-- Procedures
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `populate_ihrisdata` ()  BEGIN
DELETE from  ihrisdata where (SELECT count(`person+id`) as ihris from `national_manage`.`zebra_staff_list`) !=0;

INSERT INTO ihrisdata (ihris_pid,
district_id,
district,
nin,
ipps,
facility_type_id,
facility_id,
facility,
department,
job_id,
job,
surname,
firstname,
othername,
mobile,
telephone,
institution_type)
SELECT
DISTINCT trim(`person+id`),
trim(`district+id`),
`district+name`,
`national_id+id_num`,
`ipps_no+id_num`,
`facility+facility_type`,
trim(`facility+id`),
`facility+name`,
`department_structure+name`,
trim(`job+id`),
`job+title`,
`person+surname`,
`person+firstname`,
`person+othername`,
`person_contact_personal+mobile_phone`,
`person_contact_personal+telephone`,
`institution_type+name`

from  `national_manage`.`zebra_staff_list`;
END$$

DELIMITER ;

