(3, 1, NULL, '<p>MJ and Troy are working on an RFP for a master park plan. Over 100 membership sold in\r\nthe first month. League numbers are about the same as last year. On-line t-sheets will be ready\r\nfor summer. Youth on course program will be available this summer in the afternoons. June 6 –\r\ngrand opening of North Straight River Trail. Angie would like to see a golf cart available to shuttle\r\npeople from the shop to the trail as there are no parking signs at the beginning of the trail right\r\nnow. Deer hunt will be back to the 5 bag limit<br></p>', '2022-01-16 10:29:33', '2022-01-16 10:29:33'),
(4, 11, NULL, '<p>iuriureiureiureiure</p>', '2022-01-16 14:03:08', '2022-01-16 14:03:08'),
(5, 11, NULL, '<p><span style=\"font-family: \" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" text-align:=\"\" justify;\"=\"\">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source and good</span><br></p>', '2022-01-17 21:50:25', '2022-01-17 21:50:25');

