INSERT INTO `ncda_meeting_discusions` (`id`, `meeting_id`, `item_name`, `item_details`, `suggestion`, `created_at`, `updated_at`) VALUES
(1, 1, 'Salary Increment', '<p><span style=\"font-weight: bolder;\">Staff Report</span></p><p>Parks Jesse handed out goals for 2018 and accomplishments for 2017. He has some volunteer projects going on with the boy scouts and girl scouts. They are also working with some associations and partners on several projects. Jesse also listed several projects for spring and summer. They are waiting for weather to improve to move forward with other projects.</p><p>Lee asked about the goats we used a couple of years ago in Kriesel Park. Corky said they are boarder line on weather or not to use them again. Jesse will follow up with Chris Herzog. There is $5000 in the budget to continue with the project in needed. Lee also asked about the archery range and allowing cross bows.</p><p>Tim said they would need to follow up with the neighbors as well as get new targets. It is still part of the discussion that will be looked at later this spring. Allowing cross bows are a concern for a lot of people due to it being more powerful and dangerous. However it is more accurate and people will take less shots due to only using them to sight in their bows.</p><p>Cross bows are expensive and only those who are invested will be practicing. It is about $1600-$1800 to purchase 6 more targets. Lee asked about the 18th street trail and the drop off area. Jesse said they will put retaining wall in that area.</p>', NULL, '2022-01-16 10:00:21', '2022-01-16 10:00:21'),
(2, 1, 'Employee Benefits', '<p>Henry :</p><p>Soccer is postponed another week and then will be moved inside to the Four Seasons. We\r\nhope to make it outside the following week. The plan is to start adult softball the second week of\r\nMay. The relight the park event made between $3,300-$4,000. Laura asked about getting the\r\nfields ready for the earlybird tournament. Fields are going to get used a lot and we will do our\r\nbest to keep them up to par. </p><p>Tim also state that school gyms are all being used for high school\r\nactivities so they are not available for our use for soccer<br></p>', NULL, '2022-01-16 10:03:13', '2022-01-16 10:03:13'),
(3, 1, 'Brainstoming', '<p>Laura asked about the park maintenance line item – expenses are down and revenues are up.\r\nJesse said it could have something to do with the school district billing and how they want to be\r\npaid with their fiscal year. Jesse clarified that they will be keeping better track of time spent on\r\nschool district hours. </p><p>Lee brought up the expenses of the park maintenance line and the\r\nadministration line. Corky said we increased the budget by around $30,000 due to how our staff\r\ntime is recorded and the retiree’s payouts. Angie asked why youth recreation was down in 2017\r\nin expenditures. </p><p>Eric explained that some of that came from when Brad left and how his time was\r\nrecorded. Eric also said the revenues vary based on participations. Lee would like to see more\r\n“footnotes” on the monthly financial report clarifying or explaining any unfinished financial\r\ntransactions, (revenue or expenses) from the prior year’s (2017 in this case) numbers, such as\r\nFEMA payments, etc. That way we would have a clearer picture of why the budget numbers were\r\nnot met or close.<br></p>', NULL, '2022-01-16 10:13:10', '2022-01-16 10:13:10'),
(4, 1, 'Insurance', '<p><span style=\"color: rgb(51, 51, 51);\">Parks Jesse handed out goals for 2018 and accomplishments for 2017. He has some volunteer projects going on with the boy scouts and girl scouts. They are also working with some associations and partners on several projects.&nbsp;</span><br></p>', NULL, '2022-01-16 13:40:49', '2022-01-16 13:40:49'),
(5, 11, 'Employee Benefits', '<p><strong style=\"margin: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Lorem Ipsum</strong><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum</span><br></p>', NULL, '2022-01-16 14:16:45', '2022-01-16 14:16:45'),
